INSERT INTO `sylius_product_translation` VALUES (942,942,'Baguette pour hayon chromée CITIGO','baguette-pour-hayon-chromee-citigo-1st071360','Personnalisez et offrez à votre ŠKODA un design haut de gamme grâce à cette baguette pour hayon chromée. Matière : ABS Poids : 0,1 kg. Couleur : argent',NULL,NULL,NULL,'fr_FR'),(943,943,'Pare-boue arrière CITIGO','pare-boue-arriere-citigo-1st075101a','Améliorez la robustesse de votre véhicule et protégez le des projections de gravillons et du sel avec ces pare-boue. Contient 2 pare-boue arrière. Matière : EVA, polyéthylène. Couleur : noir',NULL,NULL,NULL,'fr_FR'),(944,944,'Pare-boue avant CITIGO','pare-boue-avant-citigo-1st075111a','Améliorez la robustesse de votre véhicule et protégez le des projections de gravillons et du sel avec ces pare-boue. Contient 2 pare-boue avant. Matière : EVA, polyéthylène. Couleur : noir',NULL,NULL,NULL,'fr_FR'),(945,945,'Caches écrous noir mat','caches-ecrous-noir-mat-1z007121501c','Personnalisez votre ŠKODA jusque dans les moindres détails. Jeu de 20 unités. Matière : polyamide. Couleur : noir mat',NULL,NULL,NULL,'fr_FR'),(946,946,'Caches écrous argent métallique','caches-ecrous-argent-metallique-1z00712157zs','Personnalisez votre ŠKODA jusque dans les moindres détails. Jeu de 20 unités. Matière : polyamide. Couleur : argent',NULL,NULL,NULL,'fr_FR'),(947,947,'Caches écrous noir brillant','caches-ecrous-noir-brillant-1z00712159b9','Personnalisez votre ŠKODA jusque dans les moindres détails. Jeu de 20 unités. Matière : polyamide. Couleur : noir brillant',NULL,NULL,NULL,'fr_FR'),(948,948,'Cache écrous noir mat pour écrous anti-vol','cache-ecrous-noir-mat-pour-ecrous-anti-vol-1z0071215a01c','Personnalisez votre ŠKODA jusque dans les moindres détails. Jeu de 20 unités. Comprend 16 caches écrous standards et 4 caches écrous pour écrous anti-vol. Écrous anti-vol disponibles dans le catalogue accessoires d\'origine ŠKODA (référence 000071597C). Matière : polyamide. Couleur : noir mat',NULL,NULL,NULL,'fr_FR'),(949,949,'Cache écrous gris mat pour écrous anti-vol','cache-ecrous-gris-mat-pour-ecrous-anti-vol-1z0071215az37','Personnalisez votre ŠKODA jusque dans les moindres détails. Jeu de 20 unités.  Comprend 16 caches écrous standards et 4 caches écrous pour écrous anti-vol. Écrous anti-vol disponibles dans le catalogue accessoires d\'origine ŠKODA (référence 000071597C). Matière : polyamide. Couleur : gris mat',NULL,NULL,NULL,'fr_FR'),(950,950,'Caches écrous gris brillant','caches-ecrous-gris-brillant-1z0071215uz7','Personnalisez votre ŠKODA jusque dans les moindres détails. Jeu de 20 unités. Matière : polyamide. Couleur : gris brillant',NULL,NULL,NULL,'fr_FR'),(951,951,'Caches écrous gris mat','caches-ecrous-gris-mat-1z0071215z37','Personnalisez votre ŠKODA jusque dans les moindres détails. Jeu de 20 unités. Matière : polyamide. Couleur : gris mat',NULL,NULL,NULL,'fr_FR'),(952,952,'Barre de séparation pour bac de coffre OCTAVIA, OCTAVIA COMBI, SUPERB et S','barre-de-separation-pour-bac-de-coffre-octavia-octavia-combi-superb-et-s-3t0017254','Protégez votre chargement lors de vos déplacements. La barre de séparation limite les mouvements de vos objets et se clipse dans les encoches prévues à cet effet sur le bac de coffre. Matière : aluminium et plastique. Couleur : noir / argent. Dimensions : 952 x 95 x 17 mm',NULL,NULL,NULL,'fr_FR'),(953,953,'Trousse de secours','trousse-de-secours-3t0093108','Kit sécurité',NULL,NULL,NULL,'fr_FR'),(954,954,'Trousse de secours  Commun','trousse-de-secours-commun-3t0093108b','Trousse de secours  Commun',NULL,NULL,NULL,'fr_FR'),(955,955,'Kit ampoules pour phares halogène SUPERB & SUPERB COMBI','kit-ampoules-pour-phares-halogene-superb-superb-combi-3v0052000','Kit ampoules Xenon. Contenu :  - Ampoules : 1 x H7, 1 x H8, 1 x H21W, 1 x W5W, 1 x PY21W, 1 x P21W - Fusibles : MINI : 1 x 5A, 1 x 7.5A, 1 x 10A, 1 x 15A, ATO : 1 x 10A, 1 x 15A, 1 x 20A, 1 x 25A, 1 x 30A, 1 x 7.5A, 1 x 40A, Jcase : 1 x 20A, 1 x 30A, 1 x 40A, 1 x 50A, 1 x 60A',