A, ATO: 1 x 10A, 1 x 15A, 1 x 20A, 1 x 25A, 1 x 30A, 1 x 5A, 1 x 7.5A',NULL,NULL,NULL,'fr_FR'),(1375,1375,'Jeu de 4 Tapis de sol textile standard','jeu-de-4-tapis-de-sol-textile-standard-1st061404bb','Jeu de 4 Tapis de sol textile standard',NULL,NULL,NULL,'fr_FR'),(1376,1376,'Jeu de 4 tapis de sol textile Prestige CITIGO','jeu-de-4-tapis-de-sol-textile-prestige-citigo-1st061404p','Protégez votre habitacle grâce à ces tapis résistants. Ce jeu contient 2 tapis avant avec logo CITIGO et 2 tapis arrière. Matière : polyamide PA6 - 700g/m² Poids du jeu : 1,7kg . Couleur : noir',NULL,NULL,NULL,'fr_FR'),(1377,1377,'Jeu de 4 tapis de sol standard Prestige CITIGO','jeu-de-4-tapis-de-sol-standard-prestige-citigo-1st061404r','Protégez votre habitacle grâce à ces tapis résistants. Ce jeu contient 2 tapis avant et 2 tapis arrière avec logo CITIGO. Matière : tapis avant (polyamide PA6), tapis arrière (Polypropylène PP) Poids du jeu : 1,5kg . Couleur : noir',NULL,NULL,NULL,'fr_FR'),(1378,1378,'Jeu de 4 tapis de sol caoutchouc CITIGO 5 portes','jeu-de-4-tapis-de-sol-caoutchouc-citigo-5-portes-1st061541a','Protégez au mieux l’habitacle de votre ŠKODA grâce à ces tapis imperméables.  Lavage facile. Ce jeu contient 2 tapis avant et 2 tapis arrière avec logo CITIGO. Matière : caoutchouc. Couleur : noir',NULL,NULL,NULL,'fr_FR'),(1379,1379,'Jeu de 4 tapis de sol caoutchouc CITIGO 3 portes','jeu-de-4-tapis-de-sol-caoutchouc-citigo-3-portes-1st061550a','Protégez au mieux l’habitacle de votre ŠKODA grâce à ces tapis imperméables.  Lavage facile. Ce jeu contient 2 tapis avant et 2 tapis arrière avec logo CITIGO. Matière : caoutchouc. Couleur : noir',NULL,NULL,NULL,'fr_FR'),(1380,1380,'Jeu de 2 filets de coffre noirs CITIGO','jeu-de-2-filets-de-coffre-noirs-citigo-1st065110','Transportez sans difficulté et en toute sécurité divers objets, en les calant dans votre coffre.  Installation simple dans les encoches déjà présentes dans votre coffre.    Le jeu contient 2 filets arrière verticaux. Couleur : noir',NULL,NULL,NULL,'fr_FR'),(1381,1381,'Barres de toit CITIGO','barres-de-toit-citigo-1st071126','Augmentez vos capacités de transport en y apposant un coffre de toit, un porte-skis ou un porte-vélos. En aluminium, solides et légères, les barres de toit s’installent facilement sur votre ŠKODA.  Charge maximum 50Kg. Dimensions : barre avant 1030mm, barre arrière 1100mm Poids : 5,5Kg',NULL,NULL,NULL,'fr_FR'),(1382,1382,'Barres de toit CITIGO 5 portes','barres-de-toit-citigo-5-portes-1st071126a','Augmentez vos capacités de transport en y apposant un coffre de toit, un porte-skis ou un porte-vélos. En aluminium, solides et légères, les barres de toit s’installent facilement sur votre ŠKODA.  Charge maximum 50Kg. Dimensions : barre avant 1030mm, barre arrière 1100mm Poids : 5,5Kg',NULL,NULL,NULL,'fr_FR'),(1383,1383,'Protection pour seuils de porte - 3 portes','protection-pour-seuils-de-porte-3-portes-1st071310b','Protection pour seuils de porte - 3 portes',NULL,NULL,NULL,'fr_FR'),(1384,1384,'Protection pour seuils de porte - 5 portes','protection-pour-seuils-de-porte-5-portes-1st071310c','Protection pour seuils de porte - 5 portes',NULL,NULL,NULL,'fr_FR'),(1386,1386,'Harnais de sécurité pour chien - Taille XL','harnais-de-securite-pour-chien-taille-xl-000084310b','Il occupe une grande partie de votre vie… et de votre voiture. Ce harnais SEAT pour chiens de 25 à 40 kg rendra les trajets plus sûrs pour votre animal et pour tout le monde. Fourni avec une sangle supplémentaire à attacher à la ceinture de sécurité et au harnais, et des crochets métalliques. Le dossier est en maille de polyester et la mousse intérieure offre plus de confort pour l’animal. Obligatoire lorsque le harnais est utilisé à l’intérieur de la voiture. Taille XL : Poitrine : 640 à 820 mm / Cou : 440 à 600 mm / Longueur : 330 mm',NULL,NULL,NULL,'fr_FR'),(1387,1387,'Harnais de sécurité pour chien - Taille L','harnais-de-securite-pour-chien-taille-l-000084310c','Pour que vos balades en voiture soient aussi sereines que vos promenades dans le quartier. Ce harnais SEAT pour chiens de 15 à 25 kg vous permettra de conduire l’esprit tranquille tout en protégeant votre animal. Fourni avec une sangle supplémentaire à attacher à la ceinture de sécurité et au harnais, et des crochets métalliques. Le dossier est en maille de polyester et la mousse intérieure offre plus de confort pour l’animal. Obligatoire lorsque le harnais est utilisé à l’intérieur de la voiture. Taille L : Poitrine : 490 à 620 mm / Cou : 340 à 480 mm / Longueur : 280 mm.',NULL,NULL,NULL,'fr_FR'),(1388,1388,'Harnais de sécurité pour chien - Taille M','harnais-de-securite-pour-chien-taille-m-000084310d','Protégez-le aussi bien qu’il vous protège avec ce harnais de sécurité pour chiens de 5 à 15 kg. Fourni avec une sangle supplémentaire à attacher à la ceinture de sécurité et au harnais, et des crochets métalliques. Le dossier est en maille de polyester et la mousse intérieure offre plus de confort pour l’animal. Obligatoire lorsque le harnais est utilisé à l’intérieur de la voiture. Taille M : Poitrine : 430 à 520 mm / Cou : 260 à 370 mm / Longueur : 230 mm.',NULL,NULL,NULL,'fr_FR'),(1389,1389,'Harnais de sécurité pour chien - Taille S','harnais-de-securite-pour-chien-taille-s-000084310e','Nous savons combien d’énergie ont certains petits chiens. Protégez votre chien avec ce harnais de sécurité SEAT et profitez de vos trajets en voiture. Fourni avec une sangle supplémentaire à attacher à la ceinture de sécurité et au harnais, et des crochets métalliques. Le dossier est en maille de polyester et la mousse intérieure offre plus de confort pour l’animal. Obligatoire lorsque le harnais est utilisé à l’intérieur de la voiture. Taille S : Poitrine : 390 à 450 mm / Cou : 210 à 270 mm / Longueur : 170 mm Recommandée pour les chiens de 2 à 5 kg',NULL,NULL,NULL,'fr_FR'),(1390,1390,'Rétroviseur intérieur supplémentaire','retroviseur-interieur-supplementaire-000084418a','Gardez un œil sur vos enfants. Plus rien ne vous échappera. Avec ce rétroviseur supplémentaire, vous pourrez voir tout ce qui se passe sur la banquette arrière. Mais il sera également très utile pour avoir une meilleure vue sur la circulation à l’arrière et lorsque vous vous garez. Il se fixe à l’aide d’une ventouse qui l’empêchera de bouger.',NULL,NULL,NULL,'fr_FR'),(1391,1391,'Localisateur de clés Smart tracker','localisateur-de-cles-smart-tracker-000087013bb','Mauvaise nouvelle : vous allez continuer à perdre vos clés. Mais bonne nouvelle : vous allez maintenant les retrouver du premier coup. Pratique, ce localisateur vous alertera lorsque vous vous éloignez de vos clés, vous pouvez même le faire sonner pour les localiser facilement. Téléchargez l’application, activez votre Bluetooth et n’y pensez plus.',NULL,NULL,NULL,'fr_FR'),(1392,1392,'Kit de nettoyage Click Box','kit-de-nettoyage-click-box-000087700ba','En matière de nettoyage aussi, il y a des niveaux. Si vous êtes soigneux et aimez garder vos affaires comme neuves, vous avez besoin de produits adaptés. Ce kit professionnel est spécialisé en... tout. Il contient un shampoing à la cire, un produit d’entretien des plastiques, un produit d’entretien du cuir, de la cire à polir, un produit de polissage des surfaces vitrées et une éponge. Amusez-vous',NULL,NULL,NULL,'fr_FR'),(1393,1393,'Nettoyant multisurface 500ml','nettoyant-multisurface-500-ml-000087700cg','Produit de nettoyage multiusage à haut rendement et fort pouvoir dégraissant, très facile à utiliser, pour le nettoyage et la désinfection de tous types de surfaces. 500ml.',NULL,NULL,NULL,'fr_FR'),(1394,1394,'Chaîne à neige pneu 215/45R16 - 215/40R -','chaine-a-neige-pneu-21545-r-16-21540-r-000091301a','Améliore l´adhérence sur glace ou sur neige. Produit fabriqué 100 % textile. Montage et démontage faciles et rapides. Léger et facile à ranger. Présentation en sac plastique avec table d´application. Lavable et réutilisable. Certifié TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1395,1395,'Chaîne à neige pneu 215/45R17 - 225/40R18','chaine-a-neige-pneu-21545-r-17-22540-r-18-000091301b','Si vous êtes à l’aise sur la neige, votre SEAT se doit de l’être aussi. Avec ces chaînes neige 100% textile, vous améliorerez l’adhérence de vos pneus sur le verglas et la neige. Légères, faciles à utiliser, lavables et réutilisables. Et avec un sac pratique qui comprend aussi les instructions. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1396,1396,'Chaîne à neige pneu 165/70R14','chaine-a-neige-pneu-16570-r-14-000091303a','Pour espaces réduits, installation très facile, démontage instantané avec une seule main. Réglage automatique de tension pendant la conduite. Taille de maillon de 9 mm pour s\'adapter aux passages de roue de petite taille. Chaîne en X pour une meilleure adhérence. Tapis et gants inclus.',NULL,NULL,NULL,'fr_FR'),(1397,1397,'Chaîne à neige pneu 175/70R14','chaine-a-neige-pneu-17570-r-14-000091303b','Pour espaces réduits, grande facilité d\'installation, dépose instantanée à une main. Réglage automatique de la tension durant la conduite. Taille de maillon de 9 mm pour s\'adapter aux passages de roue de petite taille. Chaîne en X pour plus d\'adhérence. Tapis et gants compris.',NULL,NULL,NULL,'fr_FR'),(1398,1398,'Chaîne à neige pneu 185/60R15 195/55R15','chaine-a-neige-pneu-18560-r-15-19555-r-15-000091303c','Pour espaces réduits, installation très facile, démontage instantané avec une seule main. Réglage automatique de tension pendant la conduite. Taille de maillon de 9 mm pour s\'adapter aux passages de roue de petite taille. Chaîne en X pour une meilleure adhérence. Tapis et gants inclus.',NULL,NULL,NULL,'fr_FR'),(1399,1399,'Chaîne neige pour pneu 165/65R15 - 185/65R15 - 215/40R17','chaine-neige-pour-pneu-16565-r-15-18565-r-15-21540-r-17-000091303d','Qui a dit que mettre les chaînes était compliqué ? Cette chaîne en forme de X, pour une meilleure adhérence, ajuste automatiquement la tension pendant que vous roulez et se démonte d’une seule main. Taille de maillon de 9 mm pour s’adapter à des passages de roues réduits. Tapis et gants compris. Compatible avec la Leon Cupra.',NULL,NULL,NULL,'fr_FR'),(1400,1400,'Chaîne à neige pneu 205/55R16 - 215/45R17 - 215/40R18','chaine-a-neige-pneu-20555-r-16-21545-r-17-21540-r-18-000091303e','Pour espaces réduits, grande facilité de montage, démontage instantané à une seule main. Réglage automatique de la tension pendant la conduite. Maillons de 9 mm pour adaptation aux garde-boue de taille réduite. Chaîne en X pour une meilleure adhésion. Tapis et gants inclus. Cet accessoire est applicable à la Leon Cupra / Ibiza FR.',NULL,NULL,NULL,'fr_FR'),(1401,1401,'Chaîne à neige pneus 165/70R14 - 175/65R14 - 185/55R15 - 185/50R16 - 175/7','chaine-a-neige-pneus-16570-r-14-17565-r-14-18555-r-15-18550-r-16-1757-000091375aa','Améliore l\'adhérence sur gel ou neige. Produit fabriqué 100 % textile. Facile et rapide à monter et démonter. Léger et facile à ranger. Présenté dans un sac plastique avec tableau d\'application. Lavable et réutilisable. Doté de la certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1402,1402,'Chaîne neige pour les pneus 235/35R19 - 225/50R17 - 205/60R16 - 215/60R16','chaine-neige-pour-les-pneus-23535-r-19-22550-r-17-20560-r-16-21560-r-16-000091375ac','Conduisez aussi loin que la route vous mène, même lorsque celle-ci se transforme en un tapis blanc. Ces chaînes 100% textile améliorent l’adhérence sur la neige et la glace. Faciles et rapides à monter et à démonter, elles sont livrées avec un sac pratique pour le rangement, contenant les instructions. Lavable et réutilisable. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1403,1403,'Chaîne neige pour pneus 235/50R19 - 235/55R19','chaine-neige-pour-pneus-23550-r-19-23555-r-19-000091375ad','Est-ce que j’ai pris assez de pulls ? C’est la seule chose dont vous aurez à vous soucier lors de votre prochaine escapade à la neige. Avec cette chaîne pour pneus conçue pour améliorer l’adhérence sur le verglas ou la neige et qui se monte et se démonte facilement, vous oublierez tout le reste. Lavable et réutilisable, elle est livrée dans un sac avec des instructions. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1404,1404,'Chaîne neige pour les pneus 185/70R14 - 185/65R15 - 195/55R16','chaine-neige-pour-les-pneus-18570-r-14-18565-r-15-19555-r-16-000091375ae','Parfois, il suffit de traverser un tunnel pour passer de l’asphalte au verglas. Lorsque le paysage change aussi vite, vous serez vous aussi en mesure de mettre et d’enlever vos chaînes en un clin d’œil. Lavables, réutilisables, légères et accompagnées d’un sac pratique avec instructions pour un rangement facile. 100 % textile. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1405,1405,'Chaîne neige pour pneus 215/55R17 - 225/60 R16','chaine-neige-pour-pneus-21555-r-17-22560-r-16-000091375dk','Profitez des montagnes, de l’air frais et de la sensation du froid sur votre visage, et oubliez tout le reste. Ces chaînes peu encombrantes sont si faciles à monter et à démonter que vous pourrez le faire d’une seule main. De plus, elles disposent d’un réglage automatique de la tension pendant la conduite. Taille de maillon : 9 mm. Tapis et gants compris.',NULL,NULL,NULL,'fr_FR'),(1406,1406,'Chaîne à neige pneu 175/65R14 - 175/70R14 - 185/55R15','chaine-a-neige-pneu-17565-r-14-17570-r-14-18555-r-15-000091375dm','Formé de maillons métalliques qui garantissent une conduite précise et une traction maximale compatible avec les systèmes ABS et ESP. Aucun bruit ni vibration produit. Conseillés pour les véhicules à espace de roue réduit. Ils sont dotés d\'un système réfléchissant pour améliorer la visibilité lors de la conduite nocturne.',NULL,NULL,NULL,'fr_FR'),(1407,1407,'Chaîne neige pour pneu 225/45R19','chaine-neige-pour-pneu-22545-r-19-000091375eh','Snowboard ou ski ? Telle est la question. Au moins, pour équiper les roues de votre SEAT, vous ne vous poserez pas de question. Ces chaînes 100% textile sont la meilleure option. Facile et rapide à monter et à démonter, et avec un sac pratique pour le rangement qui inclut les instructions d’utilisation. Certification TÜF et GS.',NULL,NULL,NULL,'fr_FR'),(1408,1408,'Chaîne neige pour pneus 215/55R17 - 225/60 R16','chaine-neige-pour-pneus-21555-r-17-22560-r-16-000091375ej','Conduire sur la neige et le verglas sera votre nouveau passe-temps. Avec cette chaîne composée de maillons métalliques, la conduite sera si fluide et silencieuse que vous l’apprécierez comme jamais auparavant. Traction et précision maximales, compatible avec les systèmes ABS et ESP et recommandée pour les véhicules à garde au sol réduite. Munie d’un système réfléchissant pour améliorer la visibilité lors de la conduite nocturne.',NULL,NULL,NULL,'fr_FR'),(1409,1409,'Chaîne neige pour pneu 225/60R16','chaine-neige-pour-pneu-22560-r-16-000091375ek','Chut ! Ne les réveillez pas... Cette chaîne composée de maillons métalliques garantit une conduite précise et une traction maximale sans bruit ni vibration, idéale pour les passagers qui profitent du voyage pour faire une sieste. Recommandée pour les véhicules à espace de roue réduit, compatible avec les systèmes ABS et ESP et avec un système réfléchissant qui améliore la visibilité lors de la conduite de nuit.',NULL,NULL,NULL,'fr_FR'),(1410,1410,'Chaîne neige pour pneu 225/55R17','chaine-neige-pour-pneu-22555-r-17-000091375el','Découvrez le calme et la tranquillité de la conduite sur le verglas et la neige. Avec cette chaîne composée de maillons métalliques, vous bénéficierez d’une conduite précise et d’une traction maximale sans bruit ni vibration. Recommandée pour les véhicules à espace de roue réduit, compatible avec les systèmes ABS et ESP et avec un système réfléchissant pour améliorer la visibilité lors de la conduite de nuit.',NULL,NULL,NULL,'fr_FR'),(1411,1411,'Chaîne à neige pneu 215/55R16 - 225/45R17','chaine-a-neige-pneu-21555-r-16-22545-r-17-000091375j','Les chaînons métalliques assurent une conduite précise et la meilleure traction ; Compatible avec les systèmes ABS et ESP. Ne génère aucun bruit ni aucune vibration. Recommandé pour les véhicules à espacement de roue réduit. Comprend un système réfléchissant pour améliorer la visibilité en conduite de nuit.',NULL,NULL,NULL,'fr_FR'),(1412,1412,'Chaîne à neige pneu 215/40R17','chaine-a-neige-pneu-21540-r-17-000091375m','Les chaînons métalliques assurent une conduite précise et la meilleure traction ; Compatible avec les systèmes ABS et ESP. Ne génère aucun bruit ni aucune vibration. Recommandé pour les véhicules à espacement de roue réduit. Comprend un système réfléchissant pour améliorer la visibilité en conduite de nuit.',NULL,NULL,NULL,'fr_FR'),(1413,1413,'Chaîne à neige pneu 185/60R15 195/55R15','chaine-a-neige-pneu-18560-r-15-19555-r-15-000091375q','Formés de maillons métalliques qui garantissent une conduite précise et une traction maximale, Compatibles avec les systèmes ABS et ESP. Aucun bruit ni vibration produit. Conseillés pour les véhicules à espace de roue réduit. Ils sont dotés d\'un système réfléchissant pour améliorer la visibilité lors de la conduite nocturne.',NULL,NULL,NULL,'fr_FR'),(1414,1414,'Chaîne neige pour pneu 205/60R16 - 205/55R17 - 215/45R18 - 215/45R16 - 225','chaine-neige-pour-pneu-20560-r-16-20555-r-17-21545-r-18-21545-r-16-225-000091375s','3, 2, 1… Roulez ! Ces chaînes neige sont si faciles à installer et à retirer que vous pouvez le faire d’une seule main. Et elles disposent également d’un réglage automatique de la tension pendant la conduite. Des chaînes pour les roues à faible écartement : roues à maillons de 9 mm et chaîne en X pour une meilleure adhérence Tapis et gants inclus.',NULL,NULL,NULL,'fr_FR'),(1415,1415,'Triangle de sécurité','triangle-de-securite-000093056a','Sur la route, sentez-vous protégé même lorsque vous devez sortir de votre SEAT. Avec ce triangle réfléchissant avec système catadioptre et pieds pliants de grande stabilité, vous serez toujours visible pour les autres voitures. Il est également pliable et livré avec un sac pour le ranger facilement.',NULL,NULL,NULL,'fr_FR'),(1416,1416,'Gilet de sécurité','gilet-de-securite-000093056j','Il y a des vêtements qui sauvent des vies. Comme ce gilet de haute qualité fait d’un matériau ultraléger et d’une luminosité maximale. Ses bandes réfléchissantes 3M™ Scotchlite™ vous rendront visible où que vous soyez. Avec fermeture velcro pour plus de commodité. Parce que dans les situations délicates, chaque petit geste compte.',NULL,NULL,NULL,'fr_FR'),(1417,1417,'Triangle de présignalisation','triangle-de-presignalisation-000093600b','Sur la route, sentez-vous protégé même lorsque vous devez sortir de votre SEAT. Avec ce triangle réfléchissant avec système catadioptre et pieds pliants de grande stabilité, vous serez toujours visible pour les autres voitures. Il est également pliable et livré avec un sac pour le ranger facilement.',NULL,NULL,NULL,'fr_FR'),(1418,1418,'Lot Triangles de présignalisation','lot-triangles-de-presignalisation-000093600c','Vous avez une flotte de véhicules ? Munissez-les tous avec le triangle de sécurité réfléchissant avec système catadioptrique qui protège aussi bien le conducteur que le véhicule. Ils sont dotés de pieds pliants très stables et d’une housse. Commande minimum de 150 unités.',NULL,NULL,NULL,'fr_FR'),(1419,1419,'Gilet réfléchissant jaune','gilet-reflechissant-jaune-000093900sa','Les contretemps ne préviennent pas. C’est pourquoi ce gilet réfléchissant est tout aussi utile de jour que de nuit. Grâce à ses bandes réfléchissantes fabriquées par 3M™ et à sa couleur jaune, il est à la fois fluorescent et rétroréfléchissant, ce qui vous permet d’être vu où que vous soyez.',NULL,NULL,NULL,'fr_FR'),(1420,1420,'Gilet réfléchissant jaune (commande minimum 300 unités)','gilet-reflechissant-jaune-commande-minimum-300-unites-000093901id','Ce gilet de sécurité est très visible de jour comme de nuit, grâce à sa matière fluorescente associée à des bandes réfléchissantes fabriquées par 3M™. Et si c’est un must pour le coffre de votre SEAT, c’est un must pour toute votre flotte de véhicules. Équipez-vous ! Commande minimum 50 unités.',NULL,NULL,NULL,'fr_FR'),(1421,1421,'Pack de sécurité (triangle + gilet + trousse de secours + ampoules H1+H3+H','pack-de-securite-triangle-gilet-trousse-de-secours-ampoules-h-1-h-3-h-000093990ab','Vous et votre SEAT formez une équipe, même dans les moments difficiles. Ce kit de sécurité comprend un gilet réfléchissant, un triangle de présignalisation, une trousse de premiers secours et une boîte d’ampoules H1 + H3 + H7, pour vous aider à vous remettre de tout incident, où que vous soyez.',NULL,NULL,NULL,'fr_FR'),(1422,1422,'Pack sécurité (triangles + gilet)','pack-securite-triangles-gilet-000093990r','Kit de deux triangles de signalisation d\'urgence. Gilet réfléchissant de couleur jaune. Matériel fourni directement à partir de 50 unités.',NULL,NULL,NULL,'fr_FR'),(1423,1423,'Pack de sécurité (triangle + gilet + trousse de secours + ampoules H4)','pack-de-securite-triangle-gilet-trousse-de-secours-ampoules-h-4-000093990t','Comprend : Triangle de présignalisation Gilet réfléchissant de couleur jaune Trousse de secours Boîtier d’ampoules H4',NULL,NULL,NULL,'fr_FR'),(1424,1424,'Pack sécurité SAMART','pack-securite-samart-000093996c','Sac tissu couleur rouge, personnalisé avec logo SEAT. Jeu de deux triangles de signalisation. Gilet réfléchissant de couleur jaune. Coffret de lampes H1 + H3 + H7. Matériel livraison directe à partir de 50 unités.',NULL,NULL,NULL,'fr_FR'),(1425,1425,'Nettoyant insectes','nettoyant-insectes-000096320frabh','Ce produit enlève rapidement les taches produites par les insectes, y compris celles qui adhèrent fermement sous l\'effet du soleil ou du temps qui passe.',NULL,NULL,NULL,'fr_FR'),(1426,1426,'Nettoyeur pour tableau de bord','nettoyeur-pour-tableau-de-bord-000096320frabm','Protège contre la perte de couleur et la fissuration Rétablit l\'apparence immédiatement • Ne contient pas d\'alcool ni de substances toxiques