é mat','moulure-hayon-finition-chrome-mat-3r0071350a','Fabrication en ABS, finition chromé mat. Pour donner un style unique à votre voiture. Montage facile sur hayon de coffre.',NULL,NULL,NULL,'fr_FR'),(1463,1463,'Kit de seuils latéraux','kit-de-seuils-lateraux-3r0071610','Pièces en plastique aérodynamiques, placées sur les parties latérales de la carrosserie ; fourni avec caches et matériel d´installation. Comprend toutes les instructions nécessaires au montage.',NULL,NULL,NULL,'fr_FR'),(1464,1464,'Grille avant','grille-avant-3r0071628','Grille calandre avec design sport et motif identique à celui des grilles du pare-chocs inclus dans le kit aérodynamique EXEO et EXEO ST. La grille présente le logo SEAT et doit être complétée avec le cadre chromé de la pièce qu´elle remplace. Pièce à installer sur le pare-chocs du kit aérodynamique ou sur le pare-chocs de série',NULL,NULL,NULL,'fr_FR'),(1465,1465,'Spoiler','spoiler-3r0071650','Spoiler design port, fixation sur le hayon à l´aide d´une colle spéciale fournie avec le kit. Instructions de montage fournies.',NULL,NULL,NULL,'fr_FR'),(1466,1466,'Pédales sport','pedales-sport-3r0071700','Kit pédales en aluminium (frein, embrayage, accélérateur) avec caoutchouc noir et kit de ponts de fixation. Antidérapant. Amélioration des pédales pour une conduite sportive. Confère un fort caractère sportif à l´habitacle. Comprend des instructions de montage et des éléments de fixation. Non applicable aux véhicules ayant une boîte de vitesses automatique et le volant à droite.',NULL,NULL,NULL,'fr_FR'),(1467,1467,'Repose-pieds','repose-pieds-3r0071750','Améliore l´adhérence du repose-pieds pour la conduite sportive. Fabrication en aluminium et caoutchouc pour une meilleure adhérence. Renforce le caractère sportif de l´intérieur du véhicule. Comprend des instructions de montage et des éléments de fixation.',NULL,NULL,NULL,'fr_FR'),(1468,1468,'Kit électrique 13 pôles sans prééquipement GI','kit-electrique-13-poles-sans-preequipement-gi-3r1055204','Kit d\'installation électrique à 13 bornes pour attache de remorque, véhicules sans prééquipement d\'origine et avec le volant à gauche. Intègre tous les éléments nécessaires à sa pose. Monté avec l\'attache de remorque. Si la remorque porte des LED qui ne fonctionnent pas correctement, il est nécessaire de compléter les kits avec les pièces suivantes : Support pour centrale Réf. 8E0 907 297 B 2 écrous Réf. N 901 362.02',NULL,NULL,NULL,'fr_FR'),(1469,1469,'Film protecteur pare-chocs arrière','film-protecteur-pare-chocs-arriere-3r9071363','Feuille adhésive transparente adaptée à la forme du pare-chocs arrière pour protéger la zone de chargement.',NULL,NULL,NULL,'fr_FR'),(1470,1470,'Kit électrique 13 pôles','kit-electrique-13-poles-3r9071650','Kit électrique 13 pôles pour attache de remorque sur les voitures sans prééquipement. Câblage intérieur (à partir de la centrale) uniquement. Appareil de commande non inclus, le demander via les pièces de rechange (ETKA-ET2000). Non valable pour l\'option 1M7 / 1D8.',NULL,NULL,NULL,'fr_FR'),(1471,1471,'Moulure de protection du coffre','moulure-de-protection-du-coffre-575061155','Prenez soin de votre voiture dans les moindres détails grâce à cette moulure de protection métallique, adhésive et couleur inox, qui vous permettra de charger tout ce que vous voulez dans votre coffre sans avoir à vous inquiéter d’éventuels chocs ou frottements.',NULL,NULL,NULL,'fr_FR'),(1472,1472,'Film transparent pour pare-chocs arrière','film-transparent-pour-pare-chocs-arriere-575061701','Votre voiture a quelques astuces pour être comme au premier jour. Cette feuille adhésive adaptable à la forme du pare-choc arrière vous permettra de transporter ce que vous voulez dans votre coffre sans vous inquiéter d’éventuels frottements ou chocs.',NULL,NULL,NULL,'fr_FR'),(1473,1473,'Plateau protecteur de coffre (semi-rigide) - Double fond','plateau-protecteur-de-coffre-semi-rigide-double-fond-575061201','Valises, caisses, meubles... Chamboulez votre monde autant que vous le souhaitez. Avec cette pièce de protection en plastique flexible pour la base du coffre, aucune charge ne vous résistera. Accessoire applicable aux combinaisons suivantes : PR : - 1X0+3GN : Transmission avant et double plancher, 1X1+3GN : Transmission 4x4 et double plancher - 1X1+1G9+3GA : transmission 4x4, roue de secours, sans plancher de charge - 1X1+1G9+3GE : transmission 4x4, roue de secours et plancher de charge surélevé.',NULL,NULL,NULL,'fr_FR'),(1474,1474,'Tapis de coffre réversible','tapis-de-coffre-reversible-575061201a','Plateau adapté aux dimensions du plancher du coffre. Ce plateau est en moquette sur une face et en surface plastique sur l\'autre, ce qui lui permet de s\'adapter à tous vos besoins, esthétique identique à l\'état de la série et il permet également de transporter des objets humides et sales sans endommager le coffre. S\'adapte au coffre de l\'ATECA avec motorisation Front et 4x4 avec pack tyrefit. Applicable uniquement dans les combinaisons de PR suivantes : - 1X0+3GA: Traction avant et sans plancher de charge - 1X0+3GE: Tracción delantera y piso de carga elevado - 1X1+1G8+3GA: tracción 4x4, paquete para averías y sin piso de carga - 1X1+1G8+3GE: tracción 4x4, paquete para averías y piso de carga elevado',NULL,NULL,NULL,'fr_FR'),(1475,1475,'Plateau de protection du coffre (semi-rigide)','plateau-de-protection-du-coffre-semi-rigide-575061201b','Pièce de protection en plastique souple à placer sur la base du coffre. S\'adapte au coffre de l\'ATECA avec motorisation Front et 4x4 avec pack tyrefit.  Applicable uniquement dans les combinaisons de PR suivantes : - 1X0+3GA: Traction avant et sans plancher de charge - 1X0+3GE: Traction avant et plancher de charge surélevé - 1X1+1G8+3GA : transmission 4x4, pack anomalies et sans plancher de charge - 1X1+1G8+3GE : transmission 4x4, pack anomalies et plancher de charge surélevé',NULL,NULL,NULL,'fr_FR'),(1476,1476,'Plateau de protection du coffre à bords relevés','plateau-de-protection-du-coffre-a-bords-releves-575061201c','Pièce de protection en plastique à bords relevés à placer sur la base du coffre. Résistant et imperméable, facile à nettoyer et présentant de grandes rainures évitant le déplacement du chargement. S\'adapte au coffre de l\'ATECA avec motorisation Front et 4x4 avec pack tyrefit  Applicable uniquement dans les combinaisons de PR suivantes : - 1X0+3GA: Traction avant et sans plancher de charge - 1X0+3GE: Traction avant et plancher de charge surélevé - 1X1+1G8+3GA : transmission 4x4, pack anomalies et sans plancher de charge - 1X1+1G8+3GE : transmission 4x4, pack anomalies et plancher de charge surélevé',NULL,NULL,NULL,'fr_FR'),(1477,1477,'Plateau de protection du coffre (mousse)','plateau-de-protection-du-coffre-mousse-575061201d','Pièce de protection en mousse à placer sur la base du coffre. S\'adapte au coffre de l\'ATECA avec motorisation Front et 4x4 avec pack tyrefit.  Applicable uniquement dans les combinaisons de PR suivantes : - 1X0+3GA: Traction avant et sans plancher de charge - 1X0+3GE: Traction avant et plancher de charge surélevé - 1X1+1G8+3GA : transmission 4x4, pack anomalies et sans plancher de charge - 1X1+1G8+3GE : transmission 4x4, pack anomalies et plancher de charge surélevé',NULL,NULL,NULL,'fr_FR'),(1478,1478,'Plateau protecteur de coffre (en mousse) - Double fond','plateau-protecteur-de-coffre-en-mousse-double-fond-575061201e','Pièce de protection en mousse à placer sur la base du coffre. Il s\'adapte au plancher supérieur du coffre de l\'ATECA avec option de double fond (PR=3GN) ou avec la motorisation 4x4 et notrad. Applicable uniquement dans les combinaisons de PR suivantes : - 1X0+3GN: Traction avant et double fond - 1X1+3GN: Transmission 4x4 et double fond  - 1X1+1G9+3GA: transmission 4x4, roue de secours et sans plancher de charge - 1X1+1G9+3GE: transmission 4x4, roue de secours et plancher de charge surélevé',NULL,NULL,NULL,'fr_FR'),(1479,1479,'Plateau protecteur de coffre (semi-rigide) - Double fond','plateau-protecteur-de-coffre-semi-rigide-double-fond-575061201g','Valises, caisses, meubles... Chamboulez votre monde autant que vous le souhaitez. Avec ce plateau de protection flexible pour la base du coffre, aucune charge ne vous résistera. Il s’adapte et s’applique au plancher supérieur du coffre avec option de double fond (PR=3GN) ou avec la motorisation 4x4 et Notrad (roue de secours plate). Logo et design de la nouvelle ATECA.',NULL,NULL,NULL,'fr_FR'),(1480,1480,'Plateau de protection du coffre à bords relevés','plateau-de-protection-du-coffre-a-bords-releves-575061201h','Pièce de protection en plastique à bords relevés à placer sur la base du coffre. Résistant et imperméable, facile à nettoyer et présentant de grandes rainures évitant le déplacement du chargement. S’adapte au coffre de l’ATECA avec motorisation Front et 4Drive (4X4) avec pack Tyrefit.',NULL,NULL,NULL,'fr_FR'),(1481,1481,'Tapis en caoutchouc TPE (volant à gauche)','tapis-en-caoutchouc-tpe-volant-a-gauche-575061500041','Tapis en caoutchouc pour une protection accrue contre la saleté et les liquides. Jeu de 4 pièces. Pour véhicule avec volant à gauche (LHD). Les tapis conducteur et passager disposent d\'un système de fixation.',NULL,NULL,NULL,'fr_FR'),(1482,1482,'Pare-soleil arrière','pare-soleil-arriere-575064365','Profitez des journées ensoleillées sans souffrir des fortes températures. Avec les rideaux de protection solaire pour la fenêtre du hayon, vous contrôlerez beaucoup mieux les conditions climatiques de votre voiture. Exclusives pour ce modèle.',NULL,NULL,NULL,'fr_FR'),(1483,1483,'Rideaux solaires latéraux','rideaux-solaires-lateraux-575064365a','Rideaux de protection pour fenêtres latérales, à la fois pour les portes et glaces de custode arrière, exclusifs sur ce modèle. Les rideaux offrent une protection contre le soleil dans la zone des passagers arrière, tout en améliorant les conditions climatiques du véhicule. Ensemble composé de 4 rideaux',NULL,NULL,NULL,'fr_FR'),(1484