r la version FR.',NULL,NULL,NULL,'fr_FR'),(1519,1519,'Rétroviseur extérieur orange Samoa','retroviseur-exterieur-orange-samoa-575072530x2u','Boîtier du rétroviseur extérieur peint en couleur orange Samoa. Le pack des deux pièces est fourni. Il remplace la pièce d\'origine',NULL,NULL,NULL,'fr_FR'),(1520,1520,'Rétroviseur extérieur argent','retroviseur-exterieur-argent-575072530z76','Boîtier du rétroviseur extérieur peint en couleur argent Crossover. Le pack des deux pièces est fourni. Il remplace la pièce d\'origine',NULL,NULL,NULL,'fr_FR'),(1521,1521,'Bavettes garde-boue arrière','bavettes-garde-boue-arriere-575075101','Jeu de bavettes garde-boue arrière. Protègent le pare-chocs arrière de matériaux projetés par les roues arrière pendant la marche. Ne s\'applique pas à Ateca FR.',NULL,NULL,NULL,'fr_FR'),(1522,1522,'Bavettes garde-boue arrière FR','bavettes-garde-boue-arriere-fr-575075101a','Jeu de bavettes garde-boue arrière. Protègent le pare-chocs arrière de matériaux projetés par les roues arrière pendant la marche. Ne s’appliquent qu’à l’Ateca FR.',NULL,NULL,NULL,'fr_FR'),(1523,1523,'Bavettes garde-boue avant','bavettes-garde-boue-avant-575075111','Chaque centimètre de votre Ateca compte. Ce jeu de bavettes pare-boue avant protègera la carrosserie contre d’éventuelles projections de matériaux par les roues pendant la conduite. Accessoire non disponible pour l’Ateca FR.',NULL,NULL,NULL,'fr_FR'),(1524,1524,'Bavettes garde-boue avant FR','bavettes-garde-boue-avant-fr-575075111a','Jeu de bavettes garde-boue avant. Protègent la carrosserie de matériaux projetés par les roues avant pendant la marche. Compatible uniquement avec les finitions FR et X-Perience',NULL,NULL,NULL,'fr_FR'),(1525,1525,'Attache de remorque - Pour véhicules fabriqués jusqu\'à s. 48/2018','attache-de-remorque-pour-vehicules-fabriques-jusqua-s-482018-575092160b','Pas applicable sur les CUPRA Ateca (575092160C). Pour véhicules fabriqués jusqu\'à s. 48/2018 Attache de remorque pliante manuelle et amovible électrique. Pour véhicules sans prééquipement, accessoire à combiner avec : - Kit électrique (575055204A) - Centrale électrique (référence selon date de fabrication du véhicule) Pour poser l\'attache, il faut remplacer le revêtement côté passager comme suit :  - Pour coffre confort (PR 5A2) ou coffre confort avec cache de service (PR 5A7), le revêtement latéral 575867428 CA9 doit être remplacé par les références : × Revêtement latéral : 575867428B CA9 × Cache interrupteur : 5G0868345 81U × Interrupteur : 3G0959511A WHS  - Pour coffre avec rangement (PR 5A5), le revêtement latéral 575867428A DXO doit être remplacé par les références : × Revêtement latéral : 575867428C DXO × Cache interrupteur : 5G0868345 81U × Interrupteur : 3G0959511A WHS  Pour tous les véhicules équipés de préinstallation (PR 1D8), il faut exécuter le code 3446F pour passer au PR #D8 (Rééquipement dispositif d\'attelage rigide) et que la BCM reconnaisse le crochet.',NULL,NULL,NULL,'fr_FR'),(1526,1526,'Attelage de remorque','attelage-de-remorque-575092160c','Attelage de remorque rétractable manuel et amovible électrique pour ATECA PA. Le revêtement latéral et l’interrupteur doivent être commandés séparément. En combinaison avec : Kit électrique pour véhicules sans prééquipement et centrale électrique pour véhicules sans prééquipement VOIR ETKA',NULL,NULL,NULL,'fr_FR'),(1527,1527,'Attache de remorque - Pour véhicules fabriqués à partir de s. 48/2018','attache-de-remorque-pour-vehicules-fabriques-a-partir-de-s-482018-575092160d','Not applicable to CUPRA Ateca (575092160C). Attache de remorque pliante manuelle et amovible électrique. Pour véhicules sans prééquipement, accessoire à combiner avec : - Kit électrique (575055204A) - Centrale électrique (référence selon date de fabrication du véhicule) Pour poser l\'attache, il faut remplacer le revêtement côté passager comme suit :  - Pour coffre confort (PR 5A2) ou coffre confort avec cache de service (PR 5A7), le revêtement latéral 575867428 CA9 doit être remplacé par les références : × Revêtement latéral : 575867428B CA9 × Cache interrupteur : 5G0868345 81U × Interrupteur : 3G0959511A WHS  - Pour coffre avec rangement (PR 5A5), le revêtement latéral 575867428A DXO doit être remplacé par les références : × Revêtement latéral : 575867428C DXO × Cache interrupteur : 5G0868345 81U × Interrupteur : 3G0959511A WHS  Pour tous les véhicules équipés de préinstallation (PR 1D8), il faut exécuter le code 3446F pour passer au PR #D8 (Rééquipement dispositif d\'attelage rigide) et que la BCM reconnaisse le crochet.',NULL,NULL,NULL,'fr_FR'),(1528,1528,'Tapis en tissu (volant à gauche)','tapis-en-tissu-volant-a-gauche-575863011loe','Moquette de série avec face inférieure antidérapante. Jeu de 4 pièces. Pour véhicule avec volant à gauche (LHD). Tapis conducteur et passager dotés d\'un système de fixation.',NULL,NULL,NULL,'fr_FR'),(1529,1529,'Tapis Velpic (volant à gauche)','tapis-velpic-volant-a-gauche-576061675c041','Moquette haute densité avec face inférieure en caoutchouc. Jeu de 4 pièces. Pour véhicule avec volant à gauche (LHD). Tapis conducteur et passager disposant d\'un système de fixation.',NULL,NULL,NULL,'fr_FR'),(1530,1530,'Clignotants des rétroviseurs extérieurs LED dynamiques','clignotants-des-retroviseurs-exterieurs-led-dynamiques-5f0052215','Jeu de clignotants dynamiques complets. Les clignotants dynamiques offrent un aspect moderne et attireront les regards vers votre SEAT. Technologie LED très intense à votre disposition pour permettre une visibilité à la fois sécurisée et attrayante durant la conduite. Les feux LED s’allument successivement de l’intérieur vers l’extérieur dans la direction dans laquelle vous tournez. Cela créée un effet d’optique spécial, offrant un aspect sportif à votre véhicule. Équipement simple, permettant une installation facile et rapide.',NULL,NULL,NULL,'fr_FR'),(1531,1531,'Kit électronique 13 bornes sans prééquipement - pour véhicules fabriqués j','kit-electronique-13-bornes-sans-